description:
Den amerikanse tatureraren Jake Sawyer (Jason Behr) upptacker och utvecklar etnisk
design over hela varlden. Pa en tatueringsutstallning i Singapore, upptacker han den exotiska varlden i Samoanska tatueringar. Nar Jake impulsivt stjal ett okant samoanskt tatueringsverkyg, tar hans konst plotsligt en fruktansvard vandning, och utsatter alla han kommer i kontakt med for en dodlig fara...
